// SPDX-License-Identifier: MIT
pragma solidity >=0.6.0 <0.8.0;

interface IERC721 {
    /**
     * @dev Returns the total amount of tokens stored by the contract.
     */
    function totalSupply() external view returns (uint256);
    /**
     * @dev Returns the number of tokens in ``owner``'s account.
     */
    function balanceOf(address owner) external view returns (uint256 balance);
    /**
     * @dev Returns a token ID owned by `owner` at a given `index` of its token list.
     * Use along with {balanceOf} to enumerate all of ``owner``'s tokens.
     */
    function tokenOfOwnerByIndex(address owner, uint256 index) external view returns (uint256 tokenId);

    /**
     * @dev Returns a token ID at a given `index` of all the tokens stored by the contract.
     * Use along with {totalSupply} to enumerate all tokens.
     */
    function tokenByIndex(uint256 index) external view returns (uint256);
}

contract ERC721PeripheryV1 {
    uint256 public constant overflowId = 1e9; // because ID equals 0 is still used

    function tokenByIndexs(address erc721address, uint256[] memory indexs) external view returns (uint256[] memory tokenIds) {
        tokenIds = new uint256[](indexs.length);
        IERC721 _ERC721Contract = IERC721(erc721address);
        uint256 balance = _ERC721Contract.totalSupply();
        
        for (uint i = 0; i < indexs.length; i++) {
            if (balance > 0 && balance - 1 >= indexs[i]) {
                tokenIds[i] = _ERC721Contract.tokenByIndex(indexs[i]);
            } else {
                tokenIds[i] = overflowId;
            }
        }
    }

    function tokenOfOwnerByIndexs(address erc721address, address owner, uint256[] memory indexs) external view returns (uint256[] memory tokenIds) {
        tokenIds = new uint256[](indexs.length);
        IERC721 _ERC721Contract = IERC721(erc721address);
        uint256 balance = _ERC721Contract.balanceOf(owner);
        
        for (uint i = 0; i < indexs.length; i++) {
            if (balance > 0 && balance - 1 >= indexs[i]) {
                tokenIds[i] = _ERC721Contract.tokenOfOwnerByIndex(owner, indexs[i]);
            } else {
                tokenIds[i] = overflowId;
            }
        }
    }
}
